                    { 1, "Remy Kennedy", new DateTime(2022, 5, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), "Philippines has proven its resilience, becoming the fastest rebounding economy in the GCC. This has allowed the city to attract a significant number of individuals, both as investors, and for people choosing to live here. This has had an extremely positive effect on the real estate market, with it being a record quarter in terms of the overall transaction volume.\n\nOne key trend that we are seeing is a significant increase in the number of transactions in the prime and super prime segment with particularly high levels of activity for beach and waterfront properties. Palm Jumeirah was the most in demand, taking the highest market share within the luxury market, however Pearl Jumeirah, Jumeirah Bay Islands, and Emaar Beachfront have all seen growing interest.", "a4.jpg", "information,living,education", "Philippines Real Estate Market Report" },
                    { 2, "Jane Page", new DateTime(2022, 3, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "The purpose of the lighting in your home is to make it easier for you to see. They can do much more nevertheless. Home lighting can help create an atmosphere and add personality to your space, much like your floor plan and color scheme can.\n\nHome decorators, both experienced and novice, frequently discuss the importance of a few strategically placed lights. However, a lot of homeowners just consider table lamps and overhead lighting.\n\nMaking an extra effort with your lighting design might make your regular tasks or your upcoming house party brighter. Many of these quick fixes will increase your home’s worth as well, whether you want to modernize the kitchen or lower your energy expenditures.\n\nHere are some brilliant suggestions for lighting up your home:\n\nAdding layers: Many homeowners use overhead lighting to illuminate a space. However, reduced lighting and lamps might increase a space’s usability and adaptability. Create additional lighting sources with a range of levels by adding task lights, lamps, and more.\n\nSelect the proper bulb: The strength, shape, and size of your bulb should match those of your fixture. the next step is to pick a light color that goes well with the space. The yellow-hued soft white bulbs are an excellent option for living areas and bedrooms. Bright white lights give out an appearance that is more white than yellow, which can be useful in restrooms and kitchens. Without requiring any modification, the perfectbulb choice can assist fill spaces with the right amount of light.\n\nInclude accent lighting: To draw attention to the decorations in your home, place little lights underneath artworks or curiosities. Some accent lights need permanent wiring,while others may simply be plugged into the wall and hung where they are needed.\n\nSet the tone: Although bright areas are lovely, there are times when softer lighting is preferable. The best of both worlds can be achieved by installing a dimmer switch, whichwill enable you to quickly change the ambiance of your space. Dimmer switches, when set to low levels, also aid in regulating power use. ", "a24.jpg", "information,living,tips", "How to Improve the Lighting in Your Spacious Home" },
                    { 3, "Kirsten Wormald", new DateTime(2022, 1, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), "Building a home for oneself is an admirable lifetime achievement, an unrivalled material success, and a priceless experience. Everyone cherishes the initial house they ever purchased. Home loans are typically the favoured method for most of us to accomplish our objectives. \n\nYou receive a Diwali bonus, the large sum you lent has been repaid, or even just a raise as a result of all your hard work at work. On second thinking, you consider paying off your mortgage. Soon, you have a list of things you can do with the money, all of which seem crucial at the same time, but there isn’t enough to fulfil every ambition. The benefits and disadvantages of prepaying a home loan are listed below, nevertheless, in case you do feel that it is a priority that it be closed right away.\n\nReduced interest payments: The obvious benefit of paying off a mortgage early is a decrease in interest payments. When you prepay a sizeable sum, the amount is subtracted from the principal amount, which lowers the amount on which interest is charged and lowers the monthly interest payment (EMI).  If you shorten the term, your house loan will be paid off a few months earlier, but you will continue to make the same monthly payment. For the average person, it is advisable to maintain the same instalment amounts while lowering the regular EMI payments. The additional cash might be utilized to prepay the loan if necessary or reinvested in profitable investment schemes.\n\nTax advantage: Section 24 permits deductions for the interest component of an EMI paid throughout a financial year of up to Php. 2 lakh. Even for someone with the highest tax rate, this Section provides a provision for a tax reduction of about Php. 60,000 each year. In addition to the standard deduction of Php. 2 lakhs, first-time purchasers are also eligible for a reduction of up to Php. 50,000 through Section 80EE for the interest component. Advantages of up to 1.5 lakhs are available under Section 80C for the major component of the EMI.\n\nSo, after careful analysis and consideration of these relevant facts, it is generally better to refrain from making aggressive prepayments on a mortgage. It is important to invest wisely, identify lucrative debt or equity investment possibilities, and achieve a higher return than the tax-adjusted rate of interest paid on the mortgage.", "a71.jpg", "education, living, money", "Home Loan – Should You Pay Off or Keep Paying Instalments?" },
                    { 4, "Delilah Bloggs", new DateTime(2022, 1, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "Green buildings can be categorized by two key factors. One is to design a workspace that functions sustainably, utilizing supplies and techniques that respect the environment and effectively utilize resources.\n\nThe second is to develop a structure that complements the environment in which it is situated, without detracting from it; in fact, it should enhance its surroundings. We can only anticipate that this tendency will continue as the future of sustainable buildings is promising and expanding.\n\nBy orienting buildings for the optimum natural light and ventilation, sustainable sites seek to protect ecosystems, vegetation, biodiversity, and human influences that are detrimental to the environment. Constructing in such regions that are easily accessible to services and public transportation can save energy on air conditioning and lighting while avoiding the need for a car.\n\nBy using recycled, renewable, eco-friendly, or responsibly sourced materials as much as possible, materials & resources ensure that the materials used in the building require less energy during manufacturing. Construction waste materials should be reused and the building’s design should be optimized to use the fewest amount of resources possible.\n\nThe building’s energy demand should be kept to a minimum, and renewable and alternative energy sources should be employed, helping to reduce carbon emissions while the structure is in operation, energy efficiency demands detailed energy modeling of the to-be-built structure using digital tools.\n\nUsing clean energy and natural lighting while making the most of locally available resources and improving the quality of life for those who live there is what it means to construct a structure in this way. This provides advantages for all residents’ mental health as well as cleaner air and a nicer environment.\n\nThus, green buildings offer their inhabitants far more advantages than only natural green spaces. They have a significant role in reducing the adverse effects of human activity that result in depletion, ecological degradation, and climate variability.", "a75.jpg", "environment, education, lifestyle", "Sustainable Green Building - Why and What Does It Mean?" },
                    { 5, "Anisa Abbott", new DateTime(2022, 8, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), "Homebuyers should thoroughly investigate the developer before arranging a real estate investment. One has to be always on the lookout for the developers’ track records and use caution while buying a home. Selecting a reputable developer who inspires confidence and good faith is crucial.\n\nA reliable developer adheres to the rules currently in place imposed by the government, engages in transparent transactions, sticks to deadlines, and provides a quality product, all the while continuously defending the interests of the buyers. The tasks and procedures that developers are responsible for include buying a new property, buying existing buildings, and selling the developed site. There are therefore more layers to a real estate developer’s duties than simply providing for the needs of the customer. \n\nTo provide the homebuyer with contemporary, cutting-edge amenities, a reputable developer may anticipate the requirements of the buyer and the market. As a result, the developer will plan and build the project following those needs. A competent developer ensures that commitments made on projects are met promptly. Any prospective homeowner’s top priority is safety and security, a worry that is handled by all reputable developers that offer dependable security services in all of their properties. \n\nToday, this is easily accomplished by making searches and enquiries online. Every reputable builder has an interactive website for homebuyers. The prevailing real estate scenario is discussed in news outlets and on media websites, and reliable developers are given credibility.\n\nThe developers are similarly concerned about their profile and go to great lengths to protect it. Homebuyers will have easier access to home loans if they select a reputable developer. Because they will adhere to the timeliness standards established by homeowners and the developer, residences constructed by reputable builders are likely to offer a good return on investment.", "a78.jpg", "information, guide, education", "Why Home Buyers Must Select a Reliable Developer?" },
                    { 6, "Cadi Charles", new DateTime(2022, 9, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), "After a long, stressful day at work, it might be challenging to find some quiet time for oneself because of the conversation of family members, children’s lively banter, and the constant beeping of apps on your smartphone. Religious celebrations and sacred sites in India have historically drawn hordes of tourists seeking enlightenment and a deeper understanding of life. In most Indian homes, a mandir or prayer room is dedicated to the family’s patron god and decorated with garlands and lamps. While some incorporate it into an already-existing room, the piousness is increasingly choosing to provide the divine with their room. \n\nHere are some guidelines for making sacred space, regardless of the motivations behind your desire to reconnect with your inner self:\n\nPrivacy: Prayer rooms must be silent, so pick a place with few outside interruptions. Examine your family’s needs for space during holidays and religious gatherings.  If you don’t have a dedicated space, wooden blinds, string shutters, and shoji screens all work well as partitions. \n\nFlooring: To maintain a calm and meditative atmosphere, the room’s plush carpeting softens noises. Place a thick rug in your prayer area if you are unable to carpet the entire space. If you regularly kneel or sit on the floor for prayer, make the area more comfortable by placing ground pillows and yoga mats.\n\nFragrance: Fragrances can instantly relax the mind. Lighting some fragrant candles, incense, or aromatherapy oils will help everyone who enters the room feel more peaceful.\n\nPlants: Having flowers and houseplants around can be reviving. The atmosphere of the space can be improved with flower vases, garlands, and even houseplants that are growing.\n\nGiven the holistic benefits of prayer and chanting, which include improved pulse rate, emotions and immunity boost, lower blood pressure, increased metabolism, and relaxation, among others, medical research demonstrates that people with a routine spiritual practice enjoy better health.", "a81.jpg", "tips, apartment, education", "Sacred Room Tips for a Better Home" },
                    { 7, "Dionne Stephenson", new DateTime(2022, 1, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), "The entire family may become exhausted during a home move. There are many worries for everyone when they prepare to move and even on moving days, from uncomfortable locations to lost items. As you settle into your new home, you must take care to not overlook any crucial information. The moving advice listed below is crucial to keep in mind when you are shifting to a new house. \n\nInstall new locks: Naturally, the locks on the cupboards and drawers in your new home as well as the doors themselves have keys. Even though the real estate owners of your new residence gave you the locks, additional copies of the keys may also exist. Installing new doorknobs and locks will guarantee that the only people who own the new house keys are you, your family, or your roommates.\n\nCheck all of your home’s appliances: As you move into a new residence, some of your home’s equipment may sustain damage. Make sure to notify your house insurance provider business right away if any goods are destroyed.\n\nMake it Childproof: Keep any harmful substances and chemicals out of children’s reach. Batteries, torches, candles, and matches should all be kept in a cabinet that is both accessible and secure away from children.\n\nCheck for Insurance: Always inquire about the most recent home, health, and vehicle insurance plans with your provider firm. Additionally, if you meet the requirements, you can inquire about additional policies and think about applying for them.\n\nUpdating the address: Make sure you let everyone know, including the postal office and banks about your new residence address. After your departure, the services at the present address must be terminated. Electricity, waste disposal, newspaper subscription, cable, and telephone companies must be notified of your relocation.\n\nMake sure you make a checklist of these points and tick it off for hassle-free moving into your new residence. ", "a85.jpg", "tips, lifestyle, education", "5 Tips for Moving Into a New Home" },
                    { 8, "Bentley Rhodes", new DateTime(2022, 11, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), "The real estate sector is now more open and customer-focused than ever because of RERA and GST. However, a lack of knowledge and transparency has left consumers uncertain and frightened of property purchases. The market is favourable for home purchases right now, and with the right knowledge and assistance, you may purchase your ideal residence without suffering any long-term losses. A checklist should come before investing your entire life’s money in your haven. Make sure that everything on your checklist is checked off before you make the commitment. \n\nInformation about the project: After visiting the home and speaking with the developer, you must ensure that you are aware of every aspect of the project. Include the Internet, local sources, and acquaintances in your project research.\n\nConstruction quality: Inquire about the source of the materials utilized on the project site from the developer. You have a right to know what materials are being utilized and whether the home will last as you are investing a significant sum of money in it.\n\nLand ownership: Confirm with the developer and the municipality office if the developer is the rightful owner of the land and that there are no outstanding legal disputes regarding the property on which the building will be constructed. This will guarantee that the project won’t be delayed by legal issues and will be ready for occupancy by the developer’s predetermined date.\n\nAmenities: Discuss with the developer if any built-in utilities will be provided with the home. If so, find out which amenities will be included in the apartment sale. You may protect yourself from future challenges and unforeseen circumstances and be informed on such minute fronts.\n\nThe reputation of the developer: Confirm the developer’s reputation by asking about past projects, if they were finished on schedule, how long it took to finish those projects, whether they had approval from the Municipality, etc. \n\nFuture worth: Buying a house is a long-term investment, so the purchaser must assess the project’s potential value. For a complete grasp of what the project’s potential future value might be, research the prospective developments in the neighbourhood.\n\nIf all of these boxes are checked, purchasing a home is a wise decision, and you can move forward being confident that you have not only purchased the home of your dreams but have also made a successful investment that will pay off over time.", "a88.jpg", "education", "6 Guidelines for First-time Home Buyers" },
                    { 9, "Hawwa Rutledge", new DateTime(2022, 8, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), "When you're apartment hunting, there are certain amenities that you probably look for, like a dishwasher, an in​-unit washer/dryer or being close to public transportation. That checklist of things means you might have to go see multiple apartments before finding the right one--and renting an apartment can be pricey.\n\nHowever, if you go about your search in the right way, you can save time and money. Here's how to have the most efficient and effective apartment search:\n\n1. Set a Budget Range. \n\nWhen you see your dream apartment with that spacious living room, beautiful window views and perfect location, it can be easy to overlook the rental price. This is why it's important to set a budget before you even begin your search.\n\nSit down and figure out what you can afford per month, taking into consideration other expenses like groceries, utilities, gym membership, social activities, etc. When you have a set range in mind, you won't put yourself in the situation of cons\n\n2. Consider Time of Year\n\nThe time of year that you search for an apartment can have an impact on what you end up paying for rent. There may be a bevvy of rentals available during the summer months, but the prices will be much higher because that's the time that many people look for a place.\n\nIf time isn't a factor in your search, it may be best to find an apartment during October through December or February through March. When it's cold outside and closer to the holiday season, fewer people are looking to move.\n\n3. Narrow Down Your Search\n\nWhile it's entirely necessary to visit the apartment you're considering renting, checking out each and every rental you see online can be a waste of your time. The great thing about the Internet is that you can do the majority of your apartment search without even  leaving your home. Pick out three or four apartments that are worth the trip; then schedule an in-person visit.\n\n4. Stay Organized\n\nWhen you’ve looked at several apartments, they can all start to blend together and trying to keep track of all of the details (amenities, rental rates, security deposit amounts, contact information) can get stressful. Do yourself a favor and create a quick spreadsheet.\n\nWhen you need to get in touch with the landlord to ask a question about something, you'll have the information right where you need it, rather than having to waste time to track it down. On the spreadsheet you can also keep tabs on whether you have looked at the apartment, and any side notes that you may want to remember about the property.\n\n5. Bring Your Roommate(s)\n\nIf you're planning on moving in with one, or a few, friends, it's best to bring them along when you go to check out a place. Looking at a rental together will save you a lot of time in your search. After the showing, you can talk about it together and discuss what you like and don't like.\n\n6. Look Into Public Transportation\n\nEven if you do plan on having a car, taking public transportation to work or to run errands can save you a whole lot of money in the long run. When searching for an apartment, consider proximity to public transportation. Saving money on gas, car insurance and maintenance leaves more in your budget to devote to monthly rent and other expenses.\n\n7. Ask About Special Discounts\n\nDepending on the apartments you're considering, there may be certain special offers or move-in discounts you can take advantage of. For instance, some landlords offer your first month free if you decide to sign a longer lease. Even if there aren't any discounts, it never hurts to ask.\n\n8. Discover Average Energy Costs\n\nBefore you sign any lease, ask the landlord what the average utility costs are for the apartment. This is an expense that can really sneak up on you, so it's something that's definitely worth looking into.\n\n9. Be Prepared to Negotiate\n\nAfter you've visited your top three or four apartments, you may want to try negotiating with the landlord of the place you're most heavily considering. When the landlord knows that you have other options available, they may be more willing to work with you on the monthly rent.", "a91.jpg", "tips, education, information", "9 Tips for an Efficient Apartment Search" }
