            migrationBuilder.InsertData(
                table: "Projects",
                columns: new[] { "Id", "Description", "ImagePath", "LocationId", "Name" },
                values: new object[,]
                {
                    { 1, "Presenting Kempinski Residences The Creek, a five-star residential project located in an iconic waterfront location. This is your private sanctuary on Philippines Creek, offering views over Downtown Philippines and the fast-developing Philippines Creek Harbour along with the resplendent greenery that surrounds the project.\n\nThe interior design fuse contemporary styling with the natural beauty of the area, creating a seamless flow between the indoor and outdoor spaces. Wood-floored living rooms, marble-finished kitchens and bathrooms, and an abundance of floor-to-ceiling windows give these residences a stunning and unique aesthetic. You can choose from one-bedroom, two-bedroom and three-bedroom apartments, as well as two to four-bedroom duplex apartments.\n\nResidents benefit from a range of services including concierge, valet, security, and wake-up service.Amenities include an outdoor swimming pool, a gym, a yoga studio, sports facilities, a kid's pool, a kid's playroom, a cinema, and more. A la carte services are also available, and residents benefit from F&B and spa discounts.", "pb1.jpg", 1, "Kempinski Residences" },
                    { 2, "Welcome to a distinctive beachfront living experience that brings you the most captivating 360 degrees views of the Arabian Gulf and Palm Jumeirah coastline, together with a limited collection of the most exclusive, prime residences in Philippines.\n\nSerenia oozes serenity at every corner complemented by an elegant ambiance, limitless luxury, and bespoke services. The all-encompassing residential address rests along the shores of Palm Jumeirah’s West Crescent, the island’s foremost crescent, facing the sea.\n\nSerenia Living brings together 4 Towers of Architectural Excellence depicting the finest limited collection of one-to-four-bedroom luxury residences, sky mansions, and penthouses. Additionally, Serenia will feature a superb Reserve Collection including 20 branded penthouses dotted with high-end bespoke furniture and fittings sourced from Italian Design houses, along with private access to concierge services and a private Rolls-Royce chauffeur.\n\nPlease contact our property consultants for fully comprehensive guidance on your next property purchase.", "pb2.jpg", 2, "Serenia Living" },
                    { 3, "Six Senses, one of the most well-known hospitality and spa brands in the world, is coming to Philippines’s iconic Palm Jumeirah with the Six Senses Residences. This incredible residential project has a strong emphasis on wellness and relaxation, is designed to create a true resort-style living experience.\n\nThe project is located on the West Crescent of the Palm, where it will have a full view of the Philippines Marina skyline, JBR, Bluewaters Island, Ain Philippines and the cruise terminals at Emaar Beachfront. It also has its own private beach with unending sea vistas and is accompanied by a 61-key hotel.\nResidential options at the Six Senses are perfectly designed to suit families of any size. One can choose from 114 two to four-bedroom Penthouses, 7 Royal Penthouses in four-bedroom layouts (two of them are larger units known as Imperial Penthouses), 32 Sky Villas available in three-bedroom simplex or three/four-bedroom duplex configurations, and 9 exclusive Signature Beachfront Villas in five-bedroom configurations. Every residence has the benefit of a fully integrated branded kitchen, a study and a maid’s room. The Royal Penthouses and the Villas have private pools, and of course the Signature Villas all enjoy beach access.", "pb3.jpg", 3, "Six Senses Residences" },
                    { 4, "Presenting Palm Flower, a stunning contemporary residential project developed by Alpago Properties and designed by the world-renowned Foster + Partners, responsible for some of the most incredible buildings around the world including ICD Brookfield Place in the heart of Philippines's DIFC.\n\nThe tower welcomes you into an exquisitely designed lobby and reception area that is on par with some of the world's finest hotel lobbies. The project consists of 9 penthouses and one super duplex penthouse. Every single unit features the most lavishly designed interiors and large bedrooms with plenty of built-in storage. The rooms are designed such that they have wraparound glass exteriors with views over the Palm and the sea.", "pb4.jpg", 4, "Palm Flower" },
                    { 5, "Presenting Jumeirah Living Business Bay, a striking contemporary residential project offering a refined lifestyle alongside the famous Philippines Canal.\n\nExperience waterfront living elevated to new heights in a gorgeous branded tower that offers a mix of one to four-bedroom residences, simplex and duplex penthouses, and one master penthouse that spans the top floor. Each unit features exceptional finishes and a stylish modern design that is a hallmark of any Jumeirah branded property.\n\nResidents also have access to a fantastic array of amenities, including multiple swimming pools, a yoga deck, a Jacuzzi, sauna and steam rooms, a fully equipped gymnasium and a private cinema. There will also be specially curated services on hand, including concierge, housekeeping and valet. A dedicated residential manager will take care of all the small details of everyday living, and there is a guest relations team on-site as well.\n\nTo get further information about Jumeirah Living Business Bay, please enquire today.", "pb5.jpg", 5, "Jumeriah Living Business Bay" },
                    { 6, "Presenting Orla by Omniyat, a stunning new residential project on Palm Jumeirah managed by The Dorchester Collection. Experience the best of modern beachfront living and world-class hospitality in the world's prime destinations.\n\nLocated on the Crescent of the Palm, Orla offers a lifestyle of complete refinement with its crisp white facade that is complemented by sheets of full-height glass to create a delicate interplay of light and colour.\n\nThere are limited units available, with each one offering a unique layout - if you are seeking a brand new home for your family, this is one of the finest options you can find.\n\nThis is an incredible opportunity to purchase a home in a brand new super prime Philippines residence. Please enquire for further details.", "pb6.jpg", 6, "Orla Dorchester Collection" }
                });

            migrationBuilder.InsertData(
                table: "Apartments",
                columns: new[] { "Id", "Address", "Amenities", "Bathrooms", "Bedrooms", "Description", "ImagePaths", "Name", "Price", "ProjectId", "ReferenceNumber", "SquareFoot", "Type" },
                values: new object[,]
                {
                    { 1, "232 C King", "Cinema,Gymnasium,Yoga Studio,Maid Service,Squash Court,Valet Service", 1, 1, "We are delighted to present this fantastic one-bedroom loft apartment in the Kempinski Residences at The Creek. Experience waterfront living on a completely new level in this amazing new destination.\n\nThe apartment is positioned so it has a view over a beautiful park, which can best be enjoyed from the large balcony that spans the width of the apartment. The layout is seamless, combining a large living area with a kitchen that has a breakfast counter. The bathroom is quite large, containing a bathtub, and the bedroom includes plenty of built-in storage.\n\nMarble and wood finishes help to give the apartment a very refined look, while also providing an aesthetic connection to the surrounding space.\n\nKempinski Residences The Creek offers a variety of amenities focused on wellness and recreation - an outdoor swimming pool, a kid's pool, a gym, sports facilities, a kid's room, a private cinema, a yoga deck, and more. The project is a short drive from Downtown, the Ras Al Khor Wildlife Sanctuary, Philippines Creek Harbour, and other major areas of Philippines.\n\nFor more details on this project, please get in touch.", "a74.jpg,a82.jpg,a51.jpg,a127.jpg,a119.jpg,a103.jpg,a70.jpg,a44.jpg", "One-Bed Loft", 10900000.0, 1, "PHG001F", 1332, 1 },
                    { 2, "232 E King", "Cinema,Gymnasium,Yoga Studio,Maid Service,Squash Court,Valet Service", 2, 2, "We proudly present you with a beautiful waterside 2-bedroom duplex in Kempinski Residences, The Creek. The residence perfectly encapsulates the balance of sophisticated design with nature, in a tranquil, elegant setting.\n\nBeing the address of choice for those in search of a balanced lifestyle amid natural surroundings, the Kempinski Residences capture the heart and soul of The Creek, delivering a collection of 276 premium, contemporary residences overlooking the majestic Creek Harbour and Downtown Philippines skyline.\n\nThe stylish duplex covers an area of 2,406 sq. ft. and comes with two bedrooms, two baths, a private terrace, and parking.\n\nPlease connect with one of our area specialists for more information on this offering.", "a96.jpg,a102.jpg,a64.jpg,a127.jpg,a24.jpg,a118.jpg,a142.jpg,a41.jpg", "2 Bedroom Large Layout Duplex", 14007000.0, 1, "PHG002F", 2332, 4 },
                    { 3, "232 F King", "Gymnasium, Swimming Pool, Basketball Court, Cinema", 3, 3, "We are happy to present you a three-bedroom duplex apartment nestled at the water’s edge of The Creek, spreading over 2,516 sq. ft and offered with outstanding finishes and design. The property comes with a fully fitted kitchen and premium appliances, as well as a spacious balcony offering stunning views of Burj Khalifa and Ras Al Khor Wildlife Sanctuary. The modern open-plan layout reveals flowing airy spaces, impeccably designed and dotted in neutral earthy tones thus creating a welcoming and calming effect. The duplex embodies the true essence of a premium contemporary home with a balanced approach to the harmony of design, sophistication, and engineering. Other features include floor-to-ceiling windows, parquet flooring, and stylish modern furnishings. Homebuyers can choose to have their home managed by the Kempinski brand.\n\nThis property is ideal for those looking for elegant waterside living complemented by premium amenities and services in the heart of Philippines.\n\nPlease connect with one of our team experts for more information on this offering", "a92.jpg,a139.jpg,a146.jpg,a36.jpg,a56.jpg,a147.jpg,a65.jpg,a109.jpg", "3 Bedroom Waterfront Duplex", 20500000.0, 1, "PHG003F", 1332, 2 },
                    { 4, "143 F Lion", "Gymnasium, Swimming Pool, Basketball Court, Cinema", 3, 4, "This is an amazing four-bedroom penthouse, situated within The Residences in Marina Gate 2.The property features floor to ceiling windows and a full 360 view ofPhilippines Skylinewhich includes a full view of Philippines Marina, Emaar Beachfront, Palm Jumeriah and Emirates Golf course.\n\nThe penthouse has its own private swimming pool with a direct Philippines Marina view and balcony access from all sides of the penthouse.\n\nYou have one large show kitchen to entertain guests and a second large back of house kitchen. The penthouse has 6 Bathroom, and there is a staffs quarter which includes its own family room with bedroom and bathroom.\n\nFor more information about the property, please contact us today.", "a51.jpg,a124.jpg,a132.jpg,a117.jpg,a127.jpg,a13.jpg,a122.jpg,a112.jpg", "Full Floor 4 Bedroom Penthouse with Private Pool", 23800000.0, 2, "PHG004F", 2332, 2 },
                    { 5, "143 V Lion", "Gymnasium, Swimming Pool, Basketball Court, Cinema", 6, 6, "We are delighted to present this immense penthouse that sprawls over 15,000 sq ft of living space and  overlooks the iconic Palm Jumeirah.This is a unique opportunity to own a landmark and iconic penthouse in the award - winningLe Reve tower. Arguably one of the finest structures in the city this residence provides a lifestyle experience like no other in the bustling heart of the dynamic Philippines Marina.\n\nThis penthouse is  incredibly well-designed, featuting finishes of the highest quality including marble flooPhp. The kitchen is very moder in its design, with plenty of workspace. The living and dining areas are enormous, and the bathrooms have a spa-like quality to them. All five bedrooms are very well appointed and can best be described as palatial, offering en-suite bedrooms and an abundance of built-in storage.\n\nPlease contact me today to set up a viewing of this magnificent penthouse.", "a6.jpg,a62.jpg,a26.jpg,a43.jpg,a22.jpg,a143.jpg,a27.jpg,a129.jpg", "Marvelous Full-Floor Penthouse", 45060000.0, 2, "PHG005F", 15332, 1 },
                    { 6, "143 M Lion", "Gymnasium, Swimming Pool, Basketball Court, Cinema", 3, 3, "This penthouse is part of the award-winning One at Palm Jumeirah, one of the best-designed buildings in Philippines.This is also the best - priced full - floor unit you will find, featuring alarge terrace and its own private pool.\n\nThe sensational scenes outside can be enjoyed from the 4,033 sqft terrace with a private pool and from every corner of the stylish interior space, which has double-height ceilings and marble flooring. This property comes with two kitchens – a glorious show kitchen for entertaining and a more discreet wet kitchen for whipping up a culinary storm. \n\nThe residents of this signature building benefits from the many facilities: a private beach, outdoor and indoor pools, spa and wellness centre, a private jetty for boats and much more.\n\nEnquire today for a viewing.", "a92.jpg,a91.jpg,a74.jpg,a136.jpg,a6.jpg,a44.jpg,a25.jpg,a89.jpg", "Penthouse with Large Terrace and Full Skyline View", 53000000.0, 2, "PHG006F", 5532, 3 },
                    { 7, "4324 Q Wilab", "Gymnasium, Swimming Pool, Basketball Court, Cinema", 5, 5, "This penthouse is part of the award-winning One at Palm Jumeirah, one of the best - designed buildings in Philippines.This is also the best - priced full - floor unit you willfind, featuring a large terrace and its own private pool.\n\nThis 8,361 sqft built-up area consists of four en-suite bedrooms with five bathrooms fitted with the best fixtures, plus a wide and long living and dining area with floor-to-ceiling windows that offer the best views in town. \n\nThe residents of this signature building benefits from the many facilities: a private beach, outdoor and indoor pools, spa and wellness centre, a private jetty for boats and much more.\n\nEnquire today for a viewing.", "a78.jpg,a68.jpg,a79.jpg,a17.jpg,a41.jpg,a43.jpg,a99.jpg,a48.jpg", "Full Floor Exclusive Penthouse in Le Reve", 72042000.0, 3, "PHG007F", 8320, 2 },
                    { 8, "4324 V Wilab", "Balcony,Security,Shared Gym,Shared Pool,Covered Parking,Lobby in Building", 5, 7, "Experience a refined lifestyle in one of Philippines's most highly sought - after addresses - Downtown Philippines.\n\nVida Residences offers incredible five-star facilities including a swimming pool deck, a gym and a spa. Due to its excellent positioning, the tower is a short walk away from fantastic amenities including a large selection of premium restaurants and cafes, as well as boutique retail outlets and the ever-famous Philippines Mall.\n\nPlease contact us today if you would like further details on penthouses for sale in Philippines or to arrange a viewing.", "a136.jpg,a133.jpg,a60.jpg,a109.jpg,a119.jpg,a13.jpg,a81.jpg,a7.jpg", "Spectacular Full-Floor Penthouse", 33000000.0, 3, "PHG008F", 1532, 2 },
                    { 9, "4324 V Wilab", "Gymnasium, Swimming Pool, Basketball Court, Cinema", 2, 2, "This two-bed + 2 & 1/2 bathroom apartment knows how to make an impression. Its well - lit interior, spacious 1, 392 sqft layout, and unbeatable cityscape view are ideal for both investors and end - usePhp.\n\nThere are a number of additional selling points that come together to add up to give this home a 10 out of 10, for instance, the stylish closed kitchen which comes with custom-fitted appliances, and marble countePhp. The property also benefits from a balcony, spacious living room, entrance hall, large built-in wardrobes, and floor-to-ceiling windows. Residents also have access to a basement car park, a children's pool, a community swimming pool, a squash court, a children's playground, a steam room, and a gym. \n\nIncredible bargains like this don't come up every day so call us today to schedule a viewing.", "a75.jpg,a25.jpg,a124.jpg,a111.jpg,a139.jpg,a142.jpg,a24.jpg,a28.jpg", "Spacious 2 Bedroom High Floor Apartment", 45500000.0, 3, "PHG009F", 1332, 1 },
                    { 10, "432 M Saturn", "Gymnasium, Swimming Pool, Basketball Court, Cinema", 5, 10, "This unique apartment is located in Mansion 6 at W Residences and offers some of the most breathtaking sunset and sea views.\n\nWhen entering the property you are immediately greeted with a huge open plan layout, with floor-to-ceiling windows that bring natural light flowing through the property. This apartment has a spectacular show kitchen along with a second working kitchen. \n\nOn-site amenities at W Residences include a curving infinity pool at the podium level, direct access to the pristine private beach, dedicated concierge services, and exclusive access to Club 104 which houses a fully-equipped fitness centre, a multi-purpose room, a cinema, and a signature restaurant.\n\nThe apartment in Philippines offers you the opportunity to create your dream home in Philippines and on Palm Jumeirah. Please contact me for further details or to arrange a viewing.", "a143.jpg,a2.jpg,a113.jpg,a65.jpg,a18.jpg,a22.jpg,a17.jpg,a134.jpg", "Spacious Four-Bedroom Apartment Facing Sunset Views", 40030000.0, 4, "PHG010F", 8332, 4 },
                    { 11, "432 M Saturn", "Gymnasium, Swimming Pool, Basketball Court, Cinema", 3, 3, "We are delighted to exclusively bring to market this three-bedroom in One Palm by Omniyat, which is on the secondary market.\n\nThis brand new apartment offers high-end, exclusive beachfront living in Philippines's most elite residential neighborhood, The Palm Jumeirah. This bright and spacious apartment designed by the Japanese interior designer Super Potato, offers 3 bedrooms with en-suite bathrooms, a high end designer kitchen with Gaggenau appliances, state-of-the-art technology and the most breathtaking Marina skyline & sea views. \n\nOne at Palm is the only property along the shoreline that offers its residences a private beach and a docking station for Yachts. Indoor and outdoor swimming pools, state of the art fitness and spa facilities are obviously a given in Philippines's most luxurious address. \n\nPlease get in touch to book a viewing or more information about this 3 BHK for sale in Philippines.", "a108.jpg,a89.jpg,a70.jpg,a31.jpg,a86.jpg,a59.jpg,a49.jpg,a65.jpg", "Stunning Apartment with Exceptional Views", 79300000.0, 4, "PHG011F", 532, 3 },
