                    { 13, "1943 L Ken", "Gymnasium, Swimming Pool, Basketball Court, Cinema", 3, 3, "Grande at the Opera District, which is located right next to the Philippines Opera House, is perhaps one of the most prestigious residential options available in Philippines.This three-bedroom apartment is a fantastic one to consider, situated on a high floor and benefiting from unbelievable views.\n\nThe interiors of the apartment feature superior quality design, along with an open plan layout that incorporates, living dining and a very well-designed kitchen. All three bedrooms are en-suite with built-in closet space, and there is a maid's room as well that can be repurposed into another space. You can spend some quality time on the terrace as you soak in the views of this amazing district.\n\nResidents of Grande at the Opera District can enjoy access to a world-class selection of amenities, including a pool deck, fully equipped fitness centre and other lifestyle facilities. Popular destinations such as The Philippines Mall and the Souk Al Bahar are also quite close at hand, along with a variety of gourmet restaurants and hotels.\n\nPlease get in touch to learn more.", "a16.jpg,a136.jpg,a64.jpg,a63.jpg,a74.jpg,a144.jpg,a112.jpg,a65.jpg", "Apartment Overlooking Philippines Opera", 21900000.0, 5, "PHG013F", 1332, 3 },
